INSERT INTO `hr_job_categories_sections` VALUES (67,2,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2019-10-03 01:46:04','2019-10-03 01:46:04'),(68,2,'Background','<p><em>Country specific</em></p>',1,'2019-10-03 01:46:04','2019-10-03 01:46:04'),(69,2,'Description of Duties','<ul><li><strong>Operational</strong></li><li class=\"ql-indent-1\">Develop visualisation tools based on the Ushahidi platform related to the Venezuela crisis in Colombia.</li><li class=\"ql-indent-1\">Provide maintenance, support, development and improvements to the Integrated Information System. sidi.umaic.org (login: demo, pass: demo), prioritizing the 4W project module</li><li><strong>Maintenance  specific</strong></li><li class=\"ql-indent-1\">Implement and execute a database backup plan (MySQL) of all systems</li><li class=\"ql-indent-1\">Implement some type of profiler for Apache, PHP and MySQL to improve the performance of the systems</li><li><strong>Online reporting tool  specific</strong></li><li class=\"ql-indent-1\">Configure and maintain the online reporting tool, ReportHub, for target county implementations to support humanitarian reporting of partners including;</li><li><strong>Full stack specific</strong></li><li class=\"ql-indent-1\">Configure and maintain the online reporting tool, ReportHub, for target county implementations to support humanitarian reporting of partners including;</li><li class=\"ql-indent-2\">Country and cluster level indicators, beneficiary groups, facility types and site level reporting locations</li><li class=\"ql-indent-2\">User interface and database updates.</li><li class=\"ql-indent-1\">Further extend and develop additional data collection and analysis modules, RestAPIs and features into ReportHub as required by stakeholders to support humanitarian reporting.</li><li class=\"ql-indent-1\">Design and develop training materials and conduct training and capacity building of partners to ensure partners are able to successfully report on activities.</li><li class=\"ql-indent-1\">Requirements gathering and implementation for real-time reporting and statistical analysis in country level contexts based on the country level Humanitarian Response Plan (HRP).</li><li class=\"ql-indent-1\">Server setup, administration, management and optimization including documentation.</li><li class=\"ql-indent-1\">Data Platform software development under TDD approach following the Agile process with task breakdowns, sprint goals and sprint reviews.</li><li class=\"ql-indent-1\">Identification of new technologies and methods to improve the maintainability and scalability of the application.</li></ul>',2,'2019-10-03 01:46:04','2019-10-03 01:46:04'),(70,2,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">University degree in Information Technology, mathematics, statistics or related area.</li><li class=\"ql-indent-1\"><strong>Full stack  specific:</strong></li><li class=\"ql-indent-2\">University degree in Information Technology, mathematics, statistics or related area.</li><li class=\"ql-indent-1\"><strong>Experience</strong></li><li class=\"ql-indent-2\">Mastery of the principles of data handling and processing.</li><li class=\"ql-indent-2\">Minimum XXX years experience in web development</li><li class=\"ql-indent-3\">frontend / backend.</li><li class=\"ql-indent-2\">Extensive experience in:</li><li class=\"ql-indent-3\">PHP</li><li class=\"ql-indent-3\">MySQL</li><li class=\"ql-indent-3\">Linux servers (SLES and Centos)</li><li class=\"ql-indent-3\">JQuery</li><li class=\"ql-indent-3\">CSS3</li><li class=\"ql-indent-3\">Bootstrap</li><li class=\"ql-indent-3\">Openlayers</li><li class=\"ql-indent-3\">Leaflet</li><li class=\"ql-indent-3\">Mapserver</li><li class=\"ql-indent-3\">PostgreSQL</li><li class=\"ql-indent-3\">PostGIS</li><li class=\"ql-indent-2\">Experience in bash Linux programming and proactivity to automate scripting repetitive office tasks.</li><li class=\"ql-indent-2\"><strong>Web  specific:</strong></li><li class=\"ql-indent-3\">XXX years of relevant work experience in the design and implementation of web development applications</li><li class=\"ql-indent-2\"><strong>Full stack  specific:</strong></li><li class=\"ql-indent-3\">XXX years of relevant work experience in the design and implementation of web development applications.</li><li class=\"ql-indent-3\">Experience developing, documenting and maintaining RESTful API data services.</li><li class=\"ql-indent-3\">Experience in the design and implementation training and capacity building.</li><li class=\"ql-indent-3\">Experience with Agile development and Test-Driven Development (TDD) approach.</li><li class=\"ql-indent-3\">Experience with HTML, CSS, Material Design, JavaScript, ES6, TypeScript, Gulp, Bower, xlsForms (Kobo, ONA, ODK).</li><li class=\"ql-indent-3\">Experience with location-based data storage, data formats, manipulation and analysis.</li><li class=\"ql-indent-3\">Experience with training and capacity building.</li><li class=\"ql-indent-3\">Knowledge of UN cluster approach.</li><li class=\"ql-indent-3\">Knowledge of PostGIS, and spatial coordinate reference systems</li><li class=\"ql-indent-2\"><strong>Soft skills</strong></li><li class=\"ql-indent-3\">Ability to work in an organized manner, can carry several projects at the same time, work under pressure and meet deadlines.</li><li class=\"ql-indent-3\">Ability to communicate, in an effective and visually creative way, information and ideas in a written and oral manner.</li><li class=\"ql-indent-2\"><strong>Programmes</strong></li><li class=\"ql-indent-3\"><strong></strong>Experience with Git, Linux, PostgreSQL / PostGIS, MongoDB, Node.js, AngularJS</li></ul>',3,'2019-10-03 01:46:04','2019-10-03 01:46:04'),(71,12,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2019-10-03 20:53:30','2019-10-03 20:53:30'),(72,12,'Background','<p><em>Country specific</em></p>',1,'2019-10-03 20:53:30','2019-10-03 20:53:30'),(73,12,'Description of Duties','<p><em> la carte, then listed in sub-categories:</em></p><p><br></p><p><br></p><ul><li>Supervise and coordinate the provision of all administrative, personnel and financial support require to the project, ensuring that appropriate control reporting structure are maintained in accordance with the organisations rules and regulations.</li><li>Manage projects accounting and financial system by ensuring that appropriate cashbook prepared for each month expenses.</li><li>Coordinate and act as focal point for issues relating to finance (including salary, payment of per diem, rent, hazardous, R &amp;R, process of invoices and receipt of funds).</li><li>Coordinate the asset inventory process, including procurement and reporting in established forms to iMMAP.</li><li>Manage admin/finance issues with iMMAP head quarter office when required.</li><li>Manage logistic issues for iMMAP activities support to national mine action offices.</li><li>Undertake other duties as requested by the line manager.</li><li>Prepare all finance reports and monthly cashbook for iMMAP Syria with scanning all receipts.</li></ul>',2,'2019-10-03 20:53:30','2019-10-03 20:53:30'),(74,12,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">University an Institute degree in business administration, finance or relevant field</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">With at least XXX years or work experience in Administration field.</li><li><strong>Soft skills</strong></li><li class=\"ql-indent-1\">Flexible and adaptable to any situation.</li><li class=\"ql-indent-1\">Ability to translate XX to XX and XX to XX</li><li class=\"ql-indent-1\">Ability to work independently while under pressure and during long hours.</li><li class=\"ql-indent-1\">Excellent work habits with a willingness to work in a multi-cultural environment.</li><li class=\"ql-indent-1\">Excellent organizational skills, including proven ability in administration, financial and logistics.</li><li class=\"ql-indent-1\">Excellent communication skills, including drafting documents;</li><li><strong>Programmes</strong></li><li class=\"ql-indent-1\"><strong></strong>Excellent computer skills in the Windows and Microsoft Office especially MS Excel and MS Access.</li></ul>',3,'2019-10-03 20:53:30','2019-10-03 20:53:30'),(75,11,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2019-10-03 20:53:52','2019-10-03 20:53:52'),(76,11,'Background','<p><em>Country specific</em></p>',1,'2019-10-03 20:53:52','2019-10-03 20:53:52'),(77,11,'Description of Duties','<p>The Country Representative (CR) is the senior iMMAP management position in host country, with supervisory and managerial responsibility for all in-country personnel, programmes and policies. The CR is responsible for developing the overall iMMAP strategic direction for programming in concert with the iMMAP senior management team and local and international partners. S/He is also responsible for developing and implementing systems, policies and procedures for iMMAP operations in country. As the iMMAP senior manager in country, the CR is also responsible for financial oversight, strategic planning, monitoring and evaluation, staff safety and security, human resource management, and representation in the field. Working closely with the chief executive officer, the CR ensures that country programme operations meet the highest standard and are supportive of regional and global iMMAP strategies.</p><p><br></p><p><br></p><ul><li><strong>Strategy and Vision</strong></li><li class=\"ql-indent-1\">Formulate and plan, in consultation with key stakeholders, a clear vision of present and future programme goals and strategies which can be clearly communicated to team members, local beneficiaries, international partners, governmental counterparts, and donors.</li><li class=\"ql-indent-1\">Set direction by prioritising and organising actions and resources to achieve program and organisational objectives.</li><li class=\"ql-indent-1\">Evaluate program priorities within the country and participate in regional prioritisation.</li><li class=\"ql-indent-1\">Explore, evaluate and present new country and project funding opportunities that leverage impact and integrate initiatives and activities; support and direct related fund-raising activities with both institutional and private donors.</li><li><strong>Team Management</strong></li><li class=\"ql-indent-1\">Develop and maintain an adequate human resource plan consistent with iMMAPs policies, including current position descriptions for all iMMAP in country positions, personnel orientation and professional development plans, personnel evaluation system, field personnel policy manual, and personnel grievance procedure system.</li><li class=\"ql-indent-1\">Recruit, manage and motivate an informed, skilled and efficient team with an emphasis on excellence and achievement; encourage a team culture of learning, creativity and innovation, incorporating staff development strategies and performance management systems into the team building process.</li><li class=\"ql-indent-1\">Establish leadership and personal credibility with the iMMAP team, and implement and create an organisational culture of accountability, responsibility and quality of services.</li><li><strong>Reporting, Monitoring and Evaluation</strong></li><li class=\"ql-indent-1\">Ensure the programme is based upon sound principles of design and utilise iMMAP and donor required monitoring and evaluation systems.</li><li><strong>Representation</strong></li><li class=\"ql-indent-1\">Represent the iMMAP country programme with national and international donors, partners, media, and participate in local community activities as appropriate.</li><li class=\"ql-indent-1\">Maintain effective and positive internal contacts with iMMAP headquarters officers and staff, and external contacts with the Embassies, national and local government officials, international non-governmental organisations (NGOs), donor agency officials, vendors, media, and the general public.</li><li><strong>Fiscal, Compliance Management and Accountability</strong></li><li class=\"ql-indent-1\">Coordinate overall country budget; manage budget within approved spending levels and establish an annual cash flow plan to ensure a steady and adequate supply of funds for program activities.</li><li class=\"ql-indent-1\">Oversee budget management of sub-grantees/sub-contractors if any.</li><li class=\"ql-indent-1\">Build and maintain operational structures that ensure proper segregation of duties between finance, administration and logistics and fully support field programs.</li><li><strong>Security</strong></li><li class=\"ql-indent-1\">Manage safety and security of the entire iMMAP country team and assets according to best practices, operating standards and field realities.</li><li class=\"ql-indent-1\">Liaise with security officials of the local government and other humanitarian, relief and development stakeholders concerning crucial events, periods of increased risk, incident reporting, and security policy changes.</li></ul>',2,'2019-10-03 20:53:52','2019-10-03 20:53:52'),(78,11,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">Advanced university degree in Business Administration, Project Management, Information Science or other relevant fields;</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">At least 15 years of experience with increasing responsibility in management positions, preferably within the UN or other humanitarian organizations;</li><li class=\"ql-indent-1\">Complete understanding of the UN cluster system and its functioning;</li><li class=\"ql-indent-1\">Proven ability and experience interacting with a wide range of organizations and stakeholders from the UN, donors, clusters, NGOs;</li><li class=\"ql-indent-1\">Experience in emergency relief management and field coordination;</li><li><strong>Soft skills</strong></li><li class=\"ql-indent-1\">Strong presentation and communication skills;</li><li class=\"ql-indent-1\">Service orientated and ability to build consensus.</li><li class=\"ql-indent-1\">Ability to understand and adapt to complex and dynamic situations;</li><li class=\"ql-indent-1\">Ability to work in harsh operational environments;</li><li class=\"ql-indent-1\">Takes initiatives, manages own use of time and is self-motivating;</li><li class=\"ql-indent-1\">Self drive, flexibility and creativity.</li></ul><p><br></p>',3,'2019-10-03 20:53:52','2019-10-03 20:53:52'),(79,10,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2019-10-03 20:54:24','2019-10-03 20:54:24'),(80,10,'Background','<p><em>Country specific</em></p>',1,'2019-10-03 20:54:24','2019-10-03 20:54:24'),(81,10,'Description of Duties','<p>The communications officer (CO) assumes the primary responsibility for planning, developing and implementing communication strategies to promote iMMAPs programmes.</p><p><br></p><p><em> la carte, then listed in sub-categories:</em></p><p><br></p><p><br></p><ul><li><strong>Operational</strong></li><li class=\"ql-indent-1\">Examine the work of iMMAP in country to assess the communication capacity of the organisation and its various programs and projects, and determine communication requirements (internal and external) that must be met to support the organizations goals;</li><li class=\"ql-indent-1\">Identify and detail approaches for fulfilling iMMAPs communication requirements in country in a comprehensive and coordinated strategy that best promotes its programmes and mission;</li><li class=\"ql-indent-1\">Propose and lead the development of media related products including print, electronic, and online that can be employed to promote the work of the organisation and maximise its awareness within the wider humanitarian community;</li><li class=\"ql-indent-1\">Develop a monitoring and evaluation system to facilitate the measurement of the impact and efficiency of the new implemented communications strategy;</li><li class=\"ql-indent-1\">Where appropriate, represent the iMMAP project team with partners, and participate in local community activities;</li><li class=\"ql-indent-1\">Maintain effective and positive internal contacts with iMMAP regional officers and staff, and external contacts with national and local government officials, international non-governmental organisations (NGOs), donor agency officials, vendors, media, and the general public;</li><li class=\"ql-indent-1\">Follow iMMAP\'s branding regulations required for marking, or branding, of all iMMAP products and correspondence.</li><li class=\"ql-indent-1\">Serve as the main contributor of information regarding the Iraq program to the communications and outreach manager in HQ.</li><li class=\"ql-indent-1\">Coordinate and collaborate with the communications and outreach manager in HQ on various projects as needed.</li><li class=\"ql-indent-1\">Serve as the main contributor on iMMAP social media pages for the country related content.</li></ul><p><br></p>',2,'2019-10-03 20:54:24','2019-10-03 20:54:24'),(82,10,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">A university degree in communications, marketing or related field.</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">Minimum of XX years experience in communication, public relations, advertising, communication analysis &amp; planning, social development communication, marketing;</li><li class=\"ql-indent-1\">Thorough knowledge of the UN cluster system and how it operates</li><li class=\"ql-indent-1\">Proven ability and experience interacting with a wide range of organisations while upholding humanitarian principles of impartiality and neutrality.</li></ul>',3,'2019-10-03 20:54:24','2019-10-03 20:54:24'),(83,9,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2019-10-03 20:54:41','2019-10-03 20:54:41'),(84,9,'Background','<p><em>Country specific</em></p>',1,'2019-10-03 20:54:41','2019-10-03 20:54:41'),(85,9,'Description of Duties','<ul><li><strong>Project Management</strong></li><li class=\"ql-indent-1\">Develop programming through writing of project concept paper, proposal and budget for iMMAP using best practices in coordination with appropriate program units.</li><li class=\"ql-indent-1\">Oversee the overall design of the program ensuring objectives are met within the required time frame and budget. Where necessary ensure preventative and corrective action is taken.</li><li class=\"ql-indent-1\">Develop an implementation strategy which is appropriate to the country context and strategy.</li><li class=\"ql-indent-1\">Plan the mobilisation of resources for the implementation of program activities.</li><li class=\"ql-indent-1\">Manage a comprehensive activity plan, including resource needs analysis, covering the time frame.</li><li class=\"ql-indent-1\">Proactively inform iMMAP Head of Office of identified opportunities, risks and risk mitigation relevant to the program planning and implementation.</li><li class=\"ql-indent-1\">Maintain an overview of the national and regional context with a view to the strategic development of the project both in the current identified sites and potential of future program extension and expansion.</li><li class=\"ql-indent-1\">Support programme implementation as needed, including: developing assessments, baselines, budgets, monitoring and evaluation systems, field visits to verify data, reporting and close-out.</li><li><strong>Financial Management</strong></li><li class=\"ql-indent-1\">Plan and construct the program budget</li><li class=\"ql-indent-1\">Ensure that budgets are spent according to donor proposals and regulations.</li><li class=\"ql-indent-1\">Monitor the spending of designated programme funds in the pre-operational phase of the program.</li><li><strong>Staff Management</strong></li><li class=\"ql-indent-1\">Ensure all identification, selection and contracting related issues for the staff of the designated project are carried out in accordance with iMMAP guidelines.</li><li class=\"ql-indent-1\">Ensure that staff receive appropriate and adequate training by providing coaching.</li><li class=\"ql-indent-1\">Through a consultative leadership style and a transparent and supportive communication structure, develop and build an effective iMMAP project team.</li><li><strong>Security Management</strong></li><li class=\"ql-indent-1\">Assess and review the security status of identified areas of operation.</li><li class=\"ql-indent-1\">Ensure security plans and protocols for the areas of operation are updated and implemented.</li><li><strong>Quality Management</strong></li><li class=\"ql-indent-1\">Ensure designated projects are implemented in line with donor proposals and requirements.</li><li class=\"ql-indent-1\">Regularly assess and provide feedback and recommendations on the quality of the programmes.</li><li><strong>Representation</strong></li><li class=\"ql-indent-1\">Register iMMAP in requested countries.</li><li class=\"ql-indent-1\">Build relationships on behalf of iMMAP with bilateral donors, international non-governmental organisations, implementation partners and other agencies relevant to the implementation of the programme.</li><li class=\"ql-indent-1\">Represent iMMAP in relevant consultations and meetings.</li><li class=\"ql-indent-1\">Ensure complete and timely reporting of activities to iMMAP, donor, and implementation partners.</li><li class=\"ql-indent-1\">Assist iMMAP Head of Office with forward strategic planning, monitoring and evaluation.</li><li class=\"ql-indent-1\">Other relevant duties as assigned by the Head of Office.</li></ul>',2,'2019-10-03 20:54:41','2019-10-03 20:54:41'),(86,9,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">Bachelors or master\'s degree in international development studies preferred but not required;</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">Minimum of XXX years experience in programme management required; or equivalent combination of education and experience.</li><li class=\"ql-indent-1\">At least XXX years of work experience in similar management and/or advisor functions in international humanitarian or development aid.</li><li class=\"ql-indent-1\">Demonstrated experience and knowledge in establishing systems and overseeing programme start-up under limited time constraints as well as plan programme close-out.</li><li class=\"ql-indent-1\">Knowledge of basic programme development skills such as quantitative and qualitative monitoring and evaluation.</li><li class=\"ql-indent-1\">Knowledge of national and regional dynamics of migration and actors, and an understanding of the functioning and policy-making dynamics of these actors;</li><li class=\"ql-indent-1\">Proven and well-developed influencing and relationship-building skills in dealing with stakeholders at all levels.</li><li class=\"ql-indent-1\">Demonstrable highly developed written and oral communication skills.</li><li class=\"ql-indent-1\">Grant management experience with knowledge of the grant submission processes of major humanitarian and development donors such but not limited to the IOM, USAID, OFDA, PRM.</li><li class=\"ql-indent-1\">Experience in data collection and population monitoring.</li><li><strong>Soft skills</strong></li><li class=\"ql-indent-1\">Strong analytical skills, and apt at turning abstract discussions into concrete ideas.</li><li class=\"ql-indent-1\">Technical writing skills including developing proposals and reports.</li><li class=\"ql-indent-1\">Ability to develop and carry out work plans and solve problems independently.</li><li class=\"ql-indent-1\">Ability to perform well on tight deadlines, flexible attitude.</li><li class=\"ql-indent-1\">Ability to select, develop and lead teams.</li><li class=\"ql-indent-1\">Ability to work based on objectives.</li><li><strong>Programmes</strong></li><li class=\"ql-indent-1\">Knowledge of computer applications, in particular proficiency required in MS Office.and Google Suites.</li><li class=\"ql-indent-1\">Knowledge and experience working with Kobo Toolbox is an advantage.</li></ul>',3,'2019-10-03 20:54:41','2019-10-03 20:54:41'),(87,8,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2019-10-03 20:55:17','2019-10-03 20:55:17'),(88,8,'Background','<p><em>Country specific</em></p>',1,'2019-10-03 20:55:17','2019-10-03 20:55:17'),(89,8,'Description of Duties','<p>The context analyst will work with the iMMAP analysis team to provide in-depth analysis on the changing situation in various geographic regions of the country. These include, but not limited to, analysis of the changing political and conflict situation; analysis of local stakeholders; analysis of local governance structures; local stakeholder capacity assessments.</p><p><br></p><p><em> la carte, then listed in sub-categories:</em></p><p><br></p><p><br></p><ul><li><strong>Operational</strong></li><li class=\"ql-indent-1\">The Context Analyst will primarily be involved in tracking atmospheric data and conducting analysis, composing contextual reports based upon said analysis, supporting the production of reporting products, composing sub-district profiles, meeting with, and briefing, partners and stakeholders.</li><li class=\"ql-indent-1\">Produce regular reports and analysis while shaping tracking outputs to best fit the information needs of iMMAP partners and the humanitarian architecture;</li><li class=\"ql-indent-1\">Stay aware of political, social, economic and cultural developments that have an impact on the protection environment for inclusion in analysis and timely alerting of appropriate actors;</li><li class=\"ql-indent-1\">Contribute to survey design to ensure the most relevant information is collected at the appropriate level of disaggregation;</li><li class=\"ql-indent-1\">In coordination with iMMAPs IM and analysis teams, develop a reporting matrix and follow up throughout life of project to ensure timely and regular publishing of high-quality reports and information;</li><li class=\"ql-indent-1\">Develop report outlines and work with the IM team to enhance and automate regular reporting functions;</li><li class=\"ql-indent-1\">Provide high quality research and analysis to the iMMAP analysis team enabling evidence-based representation from the field and ensure documentation is supported;</li><li class=\"ql-indent-1\">Actively tracking and monitoring political, security/conflict, economic, social, and infrastructure related developments and dynamics in country that directly or indirectly affect refugee return scenarios.</li><li class=\"ql-indent-1\">Develop and maintain a network of key informants for the purpose of attaining and triangulating sensitive information pertaining to the local context.</li><li class=\"ql-indent-1\">Manage relations with any potential sub-partners conducting research on the local context.</li><li class=\"ql-indent-1\">Closely monitor and analyse open source media and reporting pertaining to the local context.</li><li class=\"ql-indent-1\">Work closely with iMMAP technical specialists in support of data visualisation, imagery, and GIS and keep concerned counterparts fully briefed on project implementation and progress from the functional and technical standpoints.</li><li class=\"ql-indent-1\">Support and document the review and development of the project strategy, and projected targets, and indicators per the proposal submission.</li><li class=\"ql-indent-1\">Coordinate with subcontractors inside/outside country on deliverables feeding into projects.</li></ul><p><br></p>',2,'2019-10-03 20:55:17','2019-10-03 20:55:17'),(90,8,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">Bachelors degree in politics, economics, international relations or related field required;</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">XX years experience with reporting, preferably in the field of humanitarian information management an asset;</li><li class=\"ql-indent-1\">Advanced prior knowledge of local context required;</li><li class=\"ql-indent-1\">Prior experience in refugee context required;</li><li class=\"ql-indent-1\">Familiarity with the aid system and an understanding of donor requirements;</li><li><strong>Soft skills</strong></li><li class=\"ql-indent-1\">Ability to operate in cross-cultural environment and work independently;</li><li><strong>Programmes</strong></li><li class=\"ql-indent-1\">Knowledge of Microsoft Excel;</li><li class=\"ql-indent-1\">Knowledge of Open Data Kit surveying an asset;</li><li class=\"ql-indent-1\">Knowledge of ArcGIS an asset.&nbsp;</li></ul>',3,'2019-10-03 20:55:17','2019-10-03 20:55:17'),(91,7,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2019-10-03 20:55:43','2019-10-03 20:55:43'),(92,7,'Background','<p>Country specific</p>',1,'2019-10-03 20:55:43','2019-10-03 20:55:43'),(93,7,'Description of Duties','<p>The incumbent will support and effectively contribute to the initiation, planning, design, development and implementation of humanitarian capacity building program in country. The role also involves support to the effective coordination of training and capacity building interventions at the different stages of the humanitarian training cycle.</p><p>Guided by XXX and under the supervision of XXX, the capacity building officer will provide support to capacity building activities such as organisation of training workshops and learning sessions to transfer knowledge, skills and techniques for effective humanitarian response.</p><p><br></p><p><em> la carte, then listed in sub-categories:</em></p><p><br></p><p><br></p><ul><li><strong>Operational</strong></li><li class=\"ql-indent-1\">Conduct of training needs assessments to establish priority needs and gaps in humanitarian information management capacity;</li><li class=\"ql-indent-1\">Planning and scheduling of capacity building activities in consultation with key stakeholders</li><li class=\"ql-indent-1\">Development of training and session plans, goals and objectives for humanitarian capacity building programmes based on identified gaps and capacity building priorities;&nbsp;</li><li class=\"ql-indent-1\">Design and develop capacity building curricula, syllabi, and learning materials;</li><li class=\"ql-indent-1\">Organize and deliver/co-facilitate core and advanced training and capacity building activities consistent to the needs of the humanitarian partners;&nbsp;</li><li class=\"ql-indent-1\">Research, identify and develop appropriate training packages on emerging tools and innovative technologies that enhance partner ability for effective utilization of IM tools;</li><li class=\"ql-indent-1\">Develop or identify training content and/or supporting reference resources such as presentations, practical exercises, and handouts to facilitate learning;</li><li class=\"ql-indent-1\">Conduct pre-training, in-training and post-training evaluations for feedback, address challenges and impediments to effective learning, document and share lessons learnt;</li><li class=\"ql-indent-1\">Liaise with other iMMAP capacity building programmes and ensure consistency and standardization of activities and material where possible;</li><li class=\"ql-indent-1\">Facilitate staff\'s ability to use existing and emerging technology to achieve organization\'s mission and objectives;</li><li class=\"ql-indent-1\">Train and provide technical support to the identified staff as needed on all Information Management tools and processes;</li><li class=\"ql-indent-1\">Provide mentorship and support within the scope of iMMAP capacity building plan;</li><li class=\"ql-indent-1\">Any other duties as required.</li><li class=\"ql-indent-1\">Draft humanitarian capacity building success stories for inclusion in iMMAPs reports, newsletters and social media platforms;</li></ul>',2,'2019-10-03 20:55:43','2019-10-03 20:55:43'),(94,7,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">An advanced university degree or equivalent experience in the fields of education and information management;</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">At least XXX years of relevant work experience and a background in non-profit, internationally-focused organisations;</li><li class=\"ql-indent-1\">Experience in humanitarian, crisis recovery and resilience aspects is highly desirable;</li><li class=\"ql-indent-1\">An appreciation of considerations in designing training content focused on the needs of adult learners;</li><li class=\"ql-indent-1\">Progressively responsible experience in designing needs assessments, data management, mapping and visualization, coaching and training.</li><li><strong>Soft skills</strong></li><li class=\"ql-indent-1\">Understanding of the UN cluster/sector system and how it operates.</li><li class=\"ql-indent-1\"><u>Communication:</u> Speaks and writes clearly and effectively; listens to others, exhibits interest in having two-way communication; tailors language, tone, style and format to match audience; demonstrates openness in sharing information and keeping people informed;</li><li class=\"ql-indent-1\"><u>Teamwork:</u> Works collaboratively with colleagues to achieve organisational goals; is willing to learn from others;&nbsp;</li><li class=\"ql-indent-1\"><u>Planning &amp; Organising:</u> Develops clear goals that are consistent with agreed strategies. Identifies priority activities and assignments; adjusts priorities as required. Allocates appropriate amount of time and resources for completing work. Foresees risks and allows for contingencies when planning. Monitors and adjusts plans and actions as necessary. Uses time efficiently.</li><li class=\"ql-indent-1\"><u>Client Orientation:</u> Considers all those to whom services are provided to be clients and seeks to see things from clients point of view; establishes and maintains productive partnerships with clients by gaining their trust and respect; identifies clients needs and matches them with appropriate solutions; monitors ongoing developments inside and outside the clients environment to keep informed and anticipate problems; meets timeline for delivery of products or services to client;</li><li class=\"ql-indent-1\"><u>Technological awareness:</u> Keeps abreast of available technology; understands applicability and limitation of technology to the work of the office; actively seeks to apply technology to appropriate tasks; shows willingness to learn new technology;</li><li class=\"ql-indent-1\"><u>Representation:</u> Where appropriate, represent the iMMAP in various fora. Maintain effective and positive contacts with the national and local government officials, international non-governmental organisations (NGOs), and donor agency officials, when required.</li><li class=\"ql-indent-1\">Ability to understand and adapt to complex and dynamic situations;</li><li class=\"ql-indent-1\">Ability to work under pressure;</li><li class=\"ql-indent-1\">Takes initiatives, manages own use of time and is self-motivating;</li><li class=\"ql-indent-1\">Proven ability to work in teams;</li><li class=\"ql-indent-1\">Flexible and creative.</li></ul>',3,'2019-10-03 20:55:43','2019-10-03 20:55:43'),(95,6,'Organization','<p>iMMAP is an international non governmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</p>',0,'2019-10-03 20:56:05','2019-10-03 20:56:05'),(96,6,'Background','<p><em>Country specific</em></p>',1,'2019-10-03 20:56:05','2019-10-03 20:56:05'),(97,6,'Description of Duties','<p>The Field Security Officer (FSO) will work with the iMMAP team to ensure the safety and security of all in-country staff.&nbsp;</p><p>The primary function of the FSO is to provide assistance to XXX on all safety and security issues, and accompany XXX on travel inside XXX and countries in the region. The FSO will monitor and assess local security conditions and make recommendations to XXX and the Global Security Manager as appropriate.</p><p>The FSO is committed to implementing and maintaining the highest standards of security and contingency planning in order to ensure the safety of all staff in country.</p><p><br></p><p><em> la carte, then listed in sub-categories:</em></p><p><br></p><p><br></p><ul><li><strong>Operational</strong></li><li class=\"ql-indent-1\">The FSO will monitor the security situation in country, and provide sound and timely advice to staff and management on safety and security matters.</li><li class=\"ql-indent-1\">The FSO will conduct risk assessments prior to travel, and accompany XXX during travel in country, and internationally.</li><li class=\"ql-indent-1\">The FSO will assist with the authorisation process of field visits, and assist in tracking of staff movements.</li><li class=\"ql-indent-1\">The FSO will maintain contacts with local and national authorities and international state and non-state actors, compiling threat analysis, incident reports and routine security reports.</li><li class=\"ql-indent-1\">The FSO will liaise and coordinate timely and efficiently with the line manager and the Global Security Manager regarding security incidents, threats or deficiencies which potentially could affect operations.</li><li class=\"ql-indent-1\">The FSO will ensure the implementation of safety and security policies and standard operating procedures (SOPs) as detailed by the Global Security Manager.</li><li class=\"ql-indent-1\">The FSO will conduct security induction briefs for new staff, and security update briefs for existing staff.</li><li class=\"ql-indent-1\">The FSO shall assist with monitoring all staff movements in country in close coordination with the iMMAP HQ Security Coordinator and ensure that staff follow travel authorisation protocols. In case of emergencies, the FSO shall liaise with local actors and the iMMAP Security Department.</li><li class=\"ql-indent-1\">The FSO will design and practice emergency systems, emergency communications and provisioning of emergency supplies for all staff.</li><li class=\"ql-indent-1\">The FSO will maintain the validity of emergency &amp; contingencies protocols based on the applicable Evacuation &amp; Contingency level, and conduct security training, exercise immediate action drills and regularly conduct emergency drills as prescribed in the Project Security Plan.</li><li class=\"ql-indent-1\">The FSO will ensure that communication protocols are implemented, and project warden lists are up to date.</li><li class=\"ql-indent-1\">The FSO will liaise with other humanitarian and emergency actors as well as international and national governments on safety and security matters.</li><li class=\"ql-indent-1\">The FSO will perform other duties as assigned by the line manager Global Security Manager.</li></ul>',2,'2019-10-03 20:56:05','2019-10-03 20:56:05'),(98,6,'Requirements','<ul><li><strong>Ability to provide a clear Criminal Record Check,</strong></li><li><strong>Ability to provide honourable discharge papers, if a previous member of Armed Forces or Police Service.</strong></li><li><strong>Experience</strong></li><li class=\"ql-indent-1\"><strong>Considerable practical experience of managing security in complex contexts and high-risk environments;</strong></li><li class=\"ql-indent-1\"><strong>A minimum of </strong>XXX years of relevant experience with demonstrated knowledge and understanding of working in the safety and security sector</li><li class=\"ql-indent-1\">Former military or police, or extensive experience as an NGO security officer or with a Private Security Company;</li><li class=\"ql-indent-1\">Previous experience working in international non-governmental organisation is preferred;</li><li class=\"ql-indent-1\">Strong analytical skills and ability to interpret and analyse data and translate into effective information;</li><li><strong>Soft skills </strong></li><li><strong>Ability to interact effectively with international and national personnel;</strong></li><li><strong>Ability to work well in a small team, operate under pressure, prioritise and deliver high quality work within deadlines, and meet team objectives; </strong></li></ul><p><br></p><p><br></p><ul><li class=\"ql-indent-1\"><strong> </strong></li></ul>',3,'2019-10-03 20:56:05','2019-10-03 20:56:05'),(99,5,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2019-10-03 20:56:22','2019-10-03 20:56:22'),(100,5,'Background','<p><em>Country specific</em></p>',1,'2019-10-03 20:56:22','2019-10-03 20:56:22'),(101,5,'Description of Duties','<p><em> la carte, then listed in sub-categories:</em></p><p><br></p><p><br></p><ul><li><strong>Operational</strong></li><li class=\"ql-indent-1\">Receiving and verifying reports from officers and enter data into database.</li><li class=\"ql-indent-1\">Maintain a high standard for the database and GIS capabilities.</li><li class=\"ql-indent-1\">Perform checks of all operation reports to ensure the quality of data.</li><li class=\"ql-indent-1\">Assist the staff in completing and updating all the data fields in database.</li><li class=\"ql-indent-1\">Prepare all weekly and monthly reports on data entry section in database for the office review.</li><li class=\"ql-indent-1\">Complete additional tasks assigned by the line manager.</li></ul>',2,'2019-10-03 20:56:22','2019-10-03 20:56:22'),(102,5,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">Graduate or under graduate of an Institute or University in related field with at least 1 years or work experience in the field of data management</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">Excellent computer skills in the Windows and Microsoft Office especially MS Excel and MS Access.</li><li><strong>Soft skills</strong></li><li class=\"ql-indent-1\">Ability to work independently while under pressure and during long hours.</li><li class=\"ql-indent-1\">Have excellent work habits with a willingness to work in a multi-cultural environment</li><li class=\"ql-indent-1\">Able to travel to all provinces in Iraq for any data entry support.</li><li><strong>Programmes</strong></li><li class=\"ql-indent-1\">Basic skills in using ArcGIS software.</li><li class=\"ql-indent-1\">Flexible and adaptable to any situation.</li><li><strong>Languages</strong></li><li class=\"ql-indent-1\"><strong></strong>Ability to translate Arabic to English and English to Arabic</li></ul>',3,'2019-10-03 20:56:22','2019-10-03 20:56:22'),(103,4,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2019-10-03 20:56:42','2019-10-03 20:56:42'),(104,4,'Background','<p><em>Country specific</em></p>',1,'2019-10-03 20:56:42','2019-10-03 20:56:42'),(105,4,'Description of Duties','<p>The data analyst will support coordination in the collection of information on XXXX, prepare reports, products and narratives of the situation of mixed flows.</p><p><br></p><p><em> la carte, then listed in sub-categories:</em></p><p><br></p><p><br></p><ul><li><strong>Operational</strong></li><li class=\"ql-indent-1\">Compilation and processing of information on the flows and sectoral needs.</li><li class=\"ql-indent-1\">Prepare relevant data analysis</li><li class=\"ql-indent-1\">Identify and manage information exchange flows with key organisations or institutions that provide context information</li></ul>',2,'2019-10-03 20:56:42','2019-10-03 20:56:42'),(106,4,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">Bachelor\'s degree in economics, statistics, political science, social sciences and other similar areas</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">Background in the construction of information exchange agreements</li><li class=\"ql-indent-1\">A minimum of XX years of work experience, experience with the United Nations system and humanitarian work is desirable.</li><li><strong>Soft skills</strong></li><li class=\"ql-indent-1\">Excellent analytical capacity and clear writing</li><li class=\"ql-indent-1\">Effective communication skills to work among clusters, agencies and the government</li><li class=\"ql-indent-1\">Training capabilities to teach partners how to use the necessary tools</li><li class=\"ql-indent-1\">Good organizational skills to deliver products on time and with quality</li><li><strong>Programmes</strong></li><li class=\"ql-indent-1\"><strong></strong>Microsoft Office, especially Excel, the knowledge in other tools and data programme is valued</li></ul>',3,'2019-10-03 20:56:42','2019-10-03 20:56:42'),(107,3,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2019-10-03 20:57:07','2019-10-03 20:57:07'),(108,3,'Background','<p><em>Country specific</em></p>',1,'2019-10-03 20:57:07','2019-10-03 20:57:07'),(109,3,'Description of Duties','<ul><li><strong>Operational</strong></li><li class=\"ql-indent-1\">Complete the qualitative and quantitative database cleanup process</li><li class=\"ql-indent-1\">Perform a monthly audit of information to ensure data completeness, integrity and quality.</li><li class=\"ql-indent-1\">Coordinate the installation of the IMSMA system, developing the database and making sure that the overall system is operational and meets the operational needs.</li><li class=\"ql-indent-1\">Prepare maps to show all YYY activity integrated with related factors and data analysis on GIS.</li><li class=\"ql-indent-1\">Provide monthly data analysis maps based on monthly standard reports for current hazards area contamination.</li><li class=\"ql-indent-1\">Coordination and control of all GIS functionalities with all the YYY staff and iMMAP staff.</li><li class=\"ql-indent-1\">Provide direction and GIS guidance to the YYY director.</li><li class=\"ql-indent-1\">Ensure the successful implementation of the standard working procedures for information management and GIS within national mine action office.</li><li class=\"ql-indent-1\">Assist the Technical Advisor with the development of GIS training packages and conducting different level for national mine action staff.</li><li class=\"ql-indent-1\">Ability to visit remote provinces whenever required for any Information Management technical issues.</li><li class=\"ql-indent-1\">Assist the information management technical advisor in developing the work plan and highlight technical requirements to improve capacity building.</li><li class=\"ql-indent-1\">Complete additional tasks assigned by the information management technical advisor and Country representative.</li></ul>',2,'2019-10-03 20:57:07','2019-10-03 20:57:07'),(110,3,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">Graduate of an Institute or University in the field of Information Technology, Information Management or Computer Sciences.</li><li class=\"ql-indent-1\">At least XXX years of working experience with GIS on field operational level and in a multi-cultural environment.</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">In-depth knowledge of database and GIS software, and computer networks, Good knowledge of related hardware and peripheral equipment.</li><li class=\"ql-indent-1\">Very good ability in topographical map reading.</li><li class=\"ql-indent-1\">Understanding of data QA/QC processes for information management are essential.</li><li class=\"ql-indent-1\">Possess advanced skills in MS-Access, MS SQL Server, Web design.</li><li class=\"ql-indent-1\">Advanced knowledge of software engineering theory and applications would be an asset.</li><li class=\"ql-indent-1\">Advanced knowledge of programming theory and relational database principles.</li><li><strong>Soft skills</strong></li><li class=\"ql-indent-1\">Ability to coordinate with local administrators, government, NGOs working with community projects and agencies involved in mine-action.</li><li class=\"ql-indent-1\">Ability to work under pressure and long hours at different locations.</li><li class=\"ql-indent-1\">Flexible and adaptable to any situation.</li><li class=\"ql-indent-1\">Self-reliant and able to work independently.</li><li><strong>Programmes</strong></li><li class=\"ql-indent-1\">ArcGIS</li><li class=\"ql-indent-1\">QGIS</li></ul>',3,'2019-10-03 20:57:07','2019-10-03 20:57:07'),(114,1,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2020-07-08 03:11:48','2020-07-08 03:11:48'),(115,1,'Background','<p><em>Country specific</em></p>',1,'2020-07-08 03:11:48','2020-07-08 03:11:48'),(116,1,'Presentation','<p><em>Additionally, the IMO is tasked to improve the accuracy of the data held by iMMAP and to improve and effectiveness the distribution of materials.</em></p><p><em>The IMO will support all goals and strategies of the iMMAP programme in its work with national partners, international partners and applicable donor agencies.</em></p><p><em>The IMO will develop and maintain constant and good contacts with humanitarian partners.</em></p><p><br></p><p><br></p><p><br></p><ul><li><strong>Operational</strong></li><li class=\"ql-indent-1\">The IMO will proactively gather information from sector partners, government authorities which may be of use to the sector for informing decisions;</li><li class=\"ql-indent-1\">The IMO will identify gaps in current implementing partner participants and will engage with NGOs, humanitarian and development organisations to restore renew or join participation in data sharing or IM support.</li><li class=\"ql-indent-1\">The IMO will identify barriers for information collection, collation, analysis and sharing.</li><li class=\"ql-indent-1\">The IMO will ensure timely preparation and generation of information products, and support on information sharing and dissemination through web platforms to all relevant humanitarian implementing partners.</li><li class=\"ql-indent-1\">The IMO will adapt appropriate existing IM tools including those available in-country (including from other sectors) and global level. As appropriate, design of data collection forms, ensuring that the purpose and use of all data collected is clear, collectable and easily collectable, highlighting where potential problems might arise; organise and manage the data input and initial analysis and presentation of data for the sector;</li><li class=\"ql-indent-1\">The IMO will develop standard formats for, and regular output of publication of materials and statistics highlighting the humanitarian situation in country upon request.</li><li class=\"ql-indent-1\">The IMO will facilitate mobile data collection, form development and data management.</li><li class=\"ql-indent-1\">The IMO will generate statistical reports, graphs, maps and follow up on cluster specific trends.</li><li class=\"ql-indent-1\">The IMO will support new and ongoing assessments.</li><li class=\"ql-indent-1\">Collect and consolidate data from various partners, prepare and submit reports on regular bases</li><li class=\"ql-indent-1\">Manage, analyse, document data and information from INGOs interventions </li><li class=\"ql-indent-1\">Map assistance coverage in specified area, analyse and report the potential gaps</li><li class=\"ql-indent-1\">Produce, share maps illustrating scale/coverage of assistance</li><li class=\"ql-indent-1\">Record, document and share coordination meeting minutes</li><li class=\"ql-indent-1\">Maintain data bases, provide data entry if required</li><li class=\"ql-indent-1\">Establish and maintain filing and documentation system accessible for humanitarian partners working in the area</li></ul><p><br></p><p><br></p><p><br></p><ul><li><strong>Mapping - specific</strong></li><li class=\"ql-indent-1\">The IMO will develop maps of 4Ws, sector resources, needs, Gaps per location;</li><li class=\"ql-indent-1\">The IMO will maintain geospatial databases and ensure data quality and integrity through the use of automated and manual techniques to enter, edit and process data sets;&nbsp;</li></ul><p><br></p><p><br></p><p><br></p><ul><li><strong>Representation</strong></li><li class=\"ql-indent-1\">The IMO will attend periodic information management meetings with the iMMAP IMO team and country director to share updates on ongoing IM products and activities and promote good practices in the organisation.</li><li class=\"ql-indent-1\">The IMO will participate in XXXXX cluster meetings and/or the IM working group.</li><li class=\"ql-indent-1\">The IMO will provide specific, sometimes dedicated, support to other agencies, when required.</li></ul><p><br></p><p><br></p><p><br></p><ul><li><strong>National capacity building / Training - specific</strong></li><li class=\"ql-indent-1\">The IMO will mentor iMMAP national staff to build capacity to include but not be limited to:</li><li class=\"ql-indent-2\">GIS and data management</li><li class=\"ql-indent-2\">Geospatial analysis and data analysis</li><li class=\"ql-indent-1\">The IMO will work to build a national staff trained to be able to fulfil the information management duties assigned to him/her, through guidance, training and technical support.</li><li class=\"ql-indent-1\">The IMO will conduct iMMAP demonstrations and training sessions.</li></ul><p><br></p><p><br></p><p><br></p><ul><li><strong>Cluster  specific</strong></li><li class=\"ql-indent-1\">The IMO will integrate clusterrelated and partners data on the information system developed by iMMAP.</li><li class=\"ql-indent-1\">The IMO will creation and develop of custom reports and map layers requested by either the clusters or the implementing partners or country director.</li><li class=\"ql-indent-1\">The IMO will advise on the design, developing and/or customisation of databases/dashboard from the reporting clusters or implementing partners or country director.</li><li class=\"ql-indent-1\">The IMO will ensure that all support requirements of iMMAP and other organisations are met in a timely and efficient manner.</li><li class=\"ql-indent-1\">The IMO will maintain Contact directories of sector humanitarian partners.</li><li class=\"ql-indent-1\">The IMO will create or maintain the who does What Where When (4W) database and derivative products, such as maps.</li><li class=\"ql-indent-1\">The IMO will aggregate and maintain inter-country information for education sector partners including data needed for situation analysis, response monitoring reports and common Sector data sets, including population data disaggregated by age and sex.</li><li class=\"ql-indent-1\">The IMO will identify needs and gaps for the sector.</li><li class=\"ql-indent-1\">The IMO will support development of sector monitoring reporting (PMR, humanitarian dashboard, etc.) in consultation with the sector coordinator, partners and other key stakeholders.</li></ul><p><br></p><p><br></p><p><br></p><ul><li><strong>Mine Action  specific</strong></li><li class=\"ql-indent-1\">The IMO will develop country base maps as it relates to mine and ERW data.</li><li class=\"ql-indent-1\">Liaise with the mine action implementing partners information technology and information management unit to ensure that the minimum information technology infrastructure requirements of IMSMA are supported by all HMA offices.</li><li class=\"ql-indent-1\">The IMO will develop IMSMA analytical products and reports for stakeholders.</li></ul><p><br></p><p><br></p><p><br></p><ul><li><strong>Health  specific</strong></li><li class=\"ql-indent-1\">The IMO will maintain updated databases on the health situation</li><li class=\"ql-indent-1\">The IMO will prepare a monthly sitrep on the health situation of people in need related to the XXX crisis in XXXX, including highlights in priority areas</li></ul>',2,'2020-07-08 03:11:48','2020-07-08 03:11:48');
