INSERT INTO `hr_tor_sections` VALUES (552,40,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2022-05-20 02:44:11','2022-05-20 02:44:11'),(553,40,'Background','<p><em>Country specific</em></p>',1,'2022-05-20 02:44:11','2022-05-20 02:44:11'),(554,40,'Description of Duties','<p><em> la carte, then listed in sub-categories:</em></p><p><br></p><p><br></p><ul><li>Supervise and coordinate the provision of all administrative, personnel and financial support require to the project, ensuring that appropriate control reporting structure are maintained in accordance with the organisations rules and regulations.</li><li>Manage projects accounting and financial system by ensuring that appropriate cashbook prepared for each month expenses.</li><li>Coordinate and act as focal point for issues relating to finance (including salary, payment of per diem, rent, hazardous, R &amp;R, process of invoices and receipt of funds).</li><li>Coordinate the asset inventory process, including procurement and reporting in established forms to iMMAP.</li><li>Manage admin/finance issues with iMMAP head quarter office when required.</li><li>Manage logistic issues for iMMAP activities support to national mine action offices.</li><li>Undertake other duties as requested by the line manager.</li><li>Prepare all finance reports and monthly cashbook for iMMAP Syria with scanning all receipts.</li></ul>',2,'2022-05-20 02:44:11','2022-05-20 02:44:11'),(555,40,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">University an Institute degree in business administration, finance or relevant field</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">With at least XXX years or work experience in Administration field.</li><li><strong>Soft skills</strong></li><li class=\"ql-indent-1\">Flexible and adaptable to any situation.</li><li class=\"ql-indent-1\">Ability to translate XX to XX and XX to XX</li><li class=\"ql-indent-1\">Ability to work independently while under pressure and during long hours.</li><li class=\"ql-indent-1\">Excellent work habits with a willingness to work in a multi-cultural environment.</li><li class=\"ql-indent-1\">Excellent organizational skills, including proven ability in administration, financial and logistics.</li><li class=\"ql-indent-1\">Excellent communication skills, including drafting documents;</li><li><strong>Programmes</strong></li><li class=\"ql-indent-1\"><strong></strong>Excellent computer skills in the Windows and Microsoft Office especially MS Excel and MS Access.</li></ul>',3,'2022-05-20 02:44:11','2022-05-20 02:44:11'),(556,15,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2022-09-20 03:44:13','2022-09-20 03:44:13'),(557,15,'Background','<p><em>Country specific</em></p>',1,'2022-09-20 03:44:13','2022-09-20 03:44:13'),(558,15,'Description of Duties','<p>The Country Representative (CR) is the senior iMMAP management position in host country, with supervisory and managerial responsibility for all in-country personnel, programmes and policies. The CR is responsible for developing the overall iMMAP strategic direction for programming in concert with the iMMAP senior management team and local and international partners. S/He is also responsible for developing and implementing systems, policies and procedures for iMMAP operations in country. As the iMMAP senior manager in country, the CR is also responsible for financial oversight, strategic planning, monitoring and evaluation, staff safety and security, human resource management, and representation in the field. Working closely with the chief executive officer, the CR ensures that country programme operations meet the highest standard and are supportive of regional and global iMMAP strategies.</p><p><br></p><p><br></p><ul><li><strong>Strategy and Vision</strong></li><li class=\"ql-indent-1\">Formulate and plan, in consultation with key stakeholders, a clear vision of present and future programme goals and strategies which can be clearly communicated to team members, local beneficiaries, international partners, governmental counterparts, and donors.</li><li class=\"ql-indent-1\">Set direction by prioritising and organising actions and resources to achieve program and organisational objectives.</li><li class=\"ql-indent-1\">Evaluate program priorities within the country and participate in regional prioritisation.</li><li class=\"ql-indent-1\">Explore, evaluate and present new country and project funding opportunities that leverage impact and integrate initiatives and activities; support and direct related fund-raising activities with both institutional and private donors.</li><li><strong>Team Management</strong></li><li class=\"ql-indent-1\">Develop and maintain an adequate human resource plan consistent with iMMAPs policies, including current position descriptions for all iMMAP in country positions, personnel orientation and professional development plans, personnel evaluation system, field personnel policy manual, and personnel grievance procedure system.</li><li class=\"ql-indent-1\">Recruit, manage and motivate an informed, skilled and efficient team with an emphasis on excellence and achievement; encourage a team culture of learning, creativity and innovation, incorporating staff development strategies and performance management systems into the team building process.</li><li class=\"ql-indent-1\">Establish leadership and personal credibility with the iMMAP team, and implement and create an organisational culture of accountability, responsibility and quality of services.</li><li><strong>Reporting, Monitoring and Evaluation</strong></li><li class=\"ql-indent-1\">Ensure the programme is based upon sound principles of design and utilise iMMAP and donor required monitoring and evaluation systems.</li><li><strong>Representation</strong></li><li class=\"ql-indent-1\">Represent the iMMAP country programme with national and international donors, partners, media, and participate in local community activities as appropriate.</li><li class=\"ql-indent-1\">Maintain effective and positive internal contacts with iMMAP headquarters officers and staff, and external contacts with the Embassies, national and local government officials, international non-governmental organisations (NGOs), donor agency officials, vendors, media, and the general public.</li><li><strong>Fiscal, Compliance Management and Accountability</strong></li><li class=\"ql-indent-1\">Coordinate overall country budget; manage budget within approved spending levels and establish an annual cash flow plan to ensure a steady and adequate supply of funds for program activities.</li><li class=\"ql-indent-1\">Oversee budget management of sub-grantees/sub-contractors if any.</li><li class=\"ql-indent-1\">Build and maintain operational structures that ensure proper segregation of duties between finance, administration and logistics and fully support field programs.</li><li><strong>Security</strong></li><li class=\"ql-indent-1\">Manage safety and security of the entire iMMAP country team and assets according to best practices, operating standards and field realities.</li><li class=\"ql-indent-1\">Liaise with security officials of the local government and other humanitarian, relief and development stakeholders concerning crucial events, periods of increased risk, incident reporting, and security policy changes.</li></ul>',2,'2022-09-20 03:44:13','2022-09-20 03:44:13'),(559,15,'Requirements','<ul><li><strong>Education</strong></li><li class=\"ql-indent-1\">Advanced university degree in Business Administration, Project Management, Information Science or other relevant fields;</li><li><strong>Experience</strong></li><li class=\"ql-indent-1\">At least 15 years of experience with increasing responsibility in management positions, preferably within the UN or other humanitarian organizations;</li><li class=\"ql-indent-1\">Complete understanding of the UN cluster system and its functioning;</li><li class=\"ql-indent-1\">Proven ability and experience interacting with a wide range of organizations and stakeholders from the UN, donors, clusters, NGOs;</li><li class=\"ql-indent-1\">Experience in emergency relief management and field coordination;</li><li><strong>Soft skills</strong></li><li class=\"ql-indent-1\">Strong presentation and communication skills;</li><li class=\"ql-indent-1\">Service orientated and ability to build consensus.</li><li class=\"ql-indent-1\">Ability to understand and adapt to complex and dynamic situations;</li><li class=\"ql-indent-1\">Ability to work in harsh operational environments;</li><li class=\"ql-indent-1\">Takes initiatives, manages own use of time and is self-motivating;</li><li class=\"ql-indent-1\">Self drive, flexibility and creativity.</li></ul>',3,'2022-09-20 03:44:13','2022-09-20 03:44:13'),(568,41,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>',0,'2023-02-09 16:03:15','2023-02-09 16:03:15'),(569,41,'Background','<p><em>Country specific</em></p>',1,'2023-02-09 16:03:15','2023-02-09 16:03:15'),(570,41,'Description of Duties','<p><em> la carte, then listed in sub-categories:</em></p><p><br></p><p><br></p><ul><li>Supervise and coordinate the provision of all administrative, personnel and financial support require to the project, ensuring that appropriate control reporting structure are maintained in accordance with the organisations rules and regulations.</li><li>Manage projects accounting and financial system by ensuring that appropriate cashbook prepared for each month expenses.</li><li>Coordinate and act as focal point for issues relating to finance (including salary, payment of per diem, rent, hazardous, R &amp;R, process of invoices and receipt of funds).</li><li>Coordinate the asset inventory process, including procurement and reporting in established forms to iMMAP.</li><li>Manage admin/finance issues with iMMAP head quarter office when required.</li><li>Manage logistic issues for iMMAP activities support to national mine action offices.</li><li>Undertake other duties as requested by the line manager.</li><li>Prepare all finance reports and monthly cashbook for iMMAP Syria with scanning all receipts.</li></ul>',2,'2023-02-09 16:03:15','2023-02-09 16:03:15'),(571,41,'Requi