INSERT INTO `im_test` VALUES (1,1,'Welcom to iMMAP Roster IM Test','<p>You will have 4 hours to complete on this test.</p><p><strong>This test includes 4 Exercises:</strong></p><ul><li>Data analysis (60 min)</li><li>Mapping (60 min)</li><li>Humanitarian Needs Assessment (30 min)</li><li>Communication with partners (30 min)</li></ul><p><br></p><p>Into brackets is the estimated time for completion of each exercise.</p><p>You can use any tools that you and know how to use.</p><p>The timer up there will be activated when you will have clicked on \"Start\" Button</p><p>For the 2 first exercises you will have to upload your results/products and for the 2 others, you will have to type your answer.</p><p>Do no share this test with any other colleages!</p><p>Good Luck!</p>','2019-12-16 02:52:19','2019-12-16 02:52:19',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2),(2,2,'Part 1 - Data Analysis','<p><strong>Here are two 4W datasets from two different sources. Luckily, the datasets are in the same format.</strong></p><p><strong>Combine them into one, clean the dataset and make it ready for analysis.</strong></p>','2019-12-16 02:52:19','2019-12-16 02:52:19','<p><strong>Based on the new Dataset you just created, answer the following questions:</strong></p>','<p><strong>Create a simple dashboard</strong></p><p><br></p><p><br></p><ul><li>Beneficiaries by organisation</li><li>Top 3 Activities</li><li>Activities per month</li><li>Add at least 2 more pieces of information that you think are relevant</li></ul>',409,410,NULL,NULL,NULL,NULL,NULL,2),(3,3,'Part 2 - Mapping','<p>Create 2 maps:</p>','2019-12-16 02:52:19','2019-12-16 02:52:19','<p>Use the linked dataset to find all health facilities of the type \"HOPITAL GENERAL DE REFERENCE\" that are within 3 km of a primary road.</p><p>Show all facilities that fit the criteria on a map with a label for each one of them.</p>','<p>Create a simple map that shows where the concentration of health facilities</p>',411,412,NULL,NULL,NULL,NULL,'<p>Extra task (Optional) :</p><p>Create an interactive map using the same datasets.</p>',2),(4,4,'Part 3 - Humanitarian Needs Assesment','<p>You are tasked to run a needs assessment in a region that was affected by a natural disaster.</p><p>What steps will you take to get a good idea of the humanitarian needs ?</p><p><strong>Describe your approach in bullet points</strong></p>','2019-12-16 02:52:19','2019-12-16 02:52:19',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2),(5,5,'Part 4 - Communications with Partners','<p>You are workin as an Information Management Officer for a cluster in a country affected by a natural disaster.</p><p>Your cluster coordinator made you aware that of your 37 partners only 12 have been reporting their activities on time and using the correct format. The others were either late or used an outdated reporting format.</p><p>He / she asks you to write a message that can be circulated to improve the reporting.</p><p><strong>Write a message to the partners to improve the reporting.</strong></p>','2019-12-16 02:52:19','2019-12-16 02:52:19',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2);
