INSERT INTO `job_sections` VALUES (480,33,'Organization','<p><em>iMMAP is an international non-for-profit organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>','2020-07-28 21:42:31','2020-07-28 21:42:31'),(481,33,'Scope of Work','<p><span style=\"color: rgb(85, 85, 85);\">Provide support to the Washington HQ in terms of HR operations support and policies development.</span></p>','2020-07-28 21:42:31','2020-07-28 21:42:31'),(482,33,'Description of Duties','<p><span style=\"color: rgb(85, 85, 85);\">1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Support in reviewing the PSEA policy.</span></p><p><span style=\"color: rgb(85, 85, 85);\">2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Development of policy on prevention of financing terrorism and implementation procedure.</span></p><p><span style=\"color: rgb(85, 85, 85);\">3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Development of GDPR policy and implementation procedure.</span></p><p><span style=\"color: rgb(85, 85, 85);\">4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Development of Cyber-security policy and implementation procedure.</span></p><p><span style=\"color: rgb(85, 85, 85);\">5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Development of Data protection policy and implementation procedure.</span></p><p><span style=\"color: rgb(85, 85, 85);\">6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Development of an anti-discrimination (HIV/AIDS, gender and disabilities) policy and procedure.</span></p><p><span style=\"color: rgb(85, 85, 85);\">7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Development of a Duty of Care policy.</span></p><p><span style=\"color: rgb(85, 85, 85);\">8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Development of Attention to the environment policy and procedure.</span></p><p><span style=\"color: rgb(85, 85, 85);\">9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Development of a Wages policy.</span></p><p><span style=\"color: rgb(85, 85, 85);\">10.&nbsp;&nbsp;Support in the review of the Recruitment Policy and Performance Evaluation Report procedure.</span></p><p><span style=\"color: rgb(85, 85, 85);\">11.&nbsp;&nbsp;&nbsp;Implementation of above policy and recruitment process into the new HR roster / platform</span></p><p><span style=\"color: rgb(85, 85, 85);\">12.&nbsp;&nbsp;Development of onboarding recruitment package and training.</span></p><p><span style=\"color: rgb(85, 85, 85);\">13.&nbsp;&nbsp;Support in the creation of generic job profiles for iMMAP, following the existing job profiles and the HR platform structure.</span></p><p><span style=\"color: rgb(85, 85, 85);\">14.&nbsp;&nbsp;Support in updating the policy tracker and any additional task related to policy development and implementation at the global level.</span></p>','2020-07-28 21:42:31','2020-07-28 21:42:31'),(483,33,'Supervision - Working Relations','<p><span style=\"color: rgb(51, 51, 51);\">Supervision: </span><span style=\"color: rgb(85, 85, 85);\">He/she will report directly to the Global HR Director</span></p><p><span style=\"color: rgb(51, 51, 51);\">Working Relations: </span><span style=\"color: rgb(85, 85, 85);\">He/she will coordinate with both HQ members.</span></p>','2020-07-28 21:42:31','2020-07-28 21:42:31'),(484,33,'Qualifications','<p><span style=\"color: rgb(85, 85, 85);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Fluency in written and spoken English required;</span></p><p><span style=\"color: rgb(85, 85, 85);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Fluency in written and spoken French required;</span></p><p><span style=\"color: rgb(85, 85, 85);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bachelors degree in HR, politics, economics, or related field required;</span></p><p><span style=\"color: rgb(85, 85, 85);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5 years experience with humanitarian work, operations management, regulations of European Donors and US donors.</span></p><p><span style=\"color: rgb(85, 85, 85);\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Knowledge of Microsoft office package.</span></p>','2020-07-28 21:42:31','2020-07-28 21:42:31'),(497,40,'Organization','<p><em>iMMAP is an international nongovernmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.</em></p>','2022-10-07 05:57:46','2022-10-07 05:57:46'),(498,40,'Background','<p><em>Country specific</em></p>','2022-10-07 05:57:46','2022-10-07 05:57:46'),(499,40,'Description of Duties','<p><em> la carte, then listed in sub-categories:</em></p><p><br></p><p><br></p><ul><li>Supervise and coordinate the provision of all administrative, personnel and financial support require to the project, ensuring that appropriate control reporting structure are maintained in accordance with the organisations rules and regulations.</li><li>Manage projects accounting and financial system by ensuring that appropriate cashbook prepared for each month expenses.</li><li>Coordinate and act as focal point for issues relating to finance (including salary, payment of per diem, rent, hazardous, R &amp;R, process of invoices and receipt of funds).</li><li>Coordinate the asset inventory process, inclu