INSERT INTO `roster_processes` VALUES (1,'SBP IM Roster','sbp-im-roster','<p><span style=\"color: rgb(76, 76, 76);\">The Standby Partnership (SBP) is a network of bilateral agreements between organizations and United Nations (UN) agencies. The partnership commenced in 1991 in response to the humanitarian crisis in Iraq where&nbsp;it was necessary for the United Nations (UN) to rapidly increase its human resources at short notice.</span></p><p><span style=\"color: rgb(76, 76, 76);\">Today it comprises a range of partners which provide support to UN agencies responding to humanitarian emergencies throughout the world via the secondment of gratis personnel. Each Standby Partner maintains its own roster of humanitarian experts who are called upon to fill staffing needs and gaps in UN operations</span>.</p><p>Standby Partnership Program website</p><p><span style=\"color: rgb(76, 76, 76);\">As an active and long stand member of the Standby Partnership Program, iMMAP deploys Information Management Experts on demand from United Nations Agencies. The goal is to have a pool of experts deployable within 72 hours. Therefore, if you apply for this roster, you accept to be deployed to the field with short notice and often for short time contract.&nbsp;Thus, if you are selected, your profile will have to be frequently updated in terms of availability, travel and medical documentations, skill and experience.</span></p>',0,'2019-11-11 03:00:03','2023-03-06 07:41:01','<p>jnjhjhjhbjbjhbj</p>','yes','yes',NULL,NULL,'IM',NULL),(5,'iMMAP Roster','immap-talent-poole','<p><span style=\"color: rgb(76, 76, 76);\">The iMMAP Roster aims to gather a pool of talented people willing to work with iMMAP. If you apply and your profile is selected as a match for our needs and project, you will integrate our records and will be one of the first in line in the selection process when iMMAP opens a new position for one of its numerous projects around the world. Information Management, GIS, web or tool development, communications, capacity strengthening, project management, field coordination are part of the many job categories present among the iMMAP Family, so if you think your profile and expertise may be interesting assets for iMMAP, apply for the iMMAP</span><span style=\"color: rgb(102, 102, 102);\"> </span><span style=\"color: rgb(76, 76, 76);\">Roster and be sure you will be informed as soon as a job position matches your profile and expectations.</span></p>',1,'2019-11-27 01:35:20','2020-02-04 01:58:12',NULL,'yes','yes',NULL,NULL,NULL,NULL);
