INSERT INTO `settings` VALUES (1,'Organization','organization','iMMAP is an international non governmental organisation that provides information management services to humanitarian and development organizations. Through information management, we help our partners target assistance to the worlds most vulnerable populations. Our core philosophy is that better data leads to better decisions and that better decisions lead to better outcomes. iMMAPs critical support to information value chains helps to solve operational and strategic challenges of our partners in both emergency and development contexts by enabling evidence-based decision-making for better outcomes.','2019-06-02 19:04:44','2019-06-02 19:04:44'),(2,'Mailing Address','mailing-address','RRB / ITC, 1300 Pennsylvania Avenue NW, Suite 470, Washington, DC 20004 USA','2019-09-22 22:30:41','2019-09-22 22:30:50');
